  const totalEarnings = 860;

  return (
    <div style={{ padding: '20px' }}>
      <h2>Promotions</h2>
      
      <div>
        <p><strong>Promotion Code:</strong> {promoCode}</p>
        <p><strong>Promotion Link:</strong> <a href={referralLink} target="_blank" rel="noreferrer">{referralLink}</a></p>
        <p><strong>Number of Promotions:</strong> {numberOfReferrals}</p>
